/*
+++ Escalation +++
CREDITS:
* Idea: 45rfew
* Coding: 45rfew (with help from Bhpsngum)
* Ships: Absolute Kun
* Maps: rob0nuko, X7, GumZ, EDEN and 45rfew
* Testing and debugging: 45rfew and Team Asia members
* Based on Escalation mode from Valorant
* Thanks to Paw and Rob0nuko for helping with the ship icons
CHANGELOG 1.1.1
  * Added radar UI to illuminate team's ship respawn range
  * Reduced both team's random respawn range
  * Increased upgrade points given when killing on the current stage (0.5 -> 0.75)
  * Upon reaching the final stage all ships belonging to corresponding team will upgrade into the final ship
  * Fixed gameover bug when 2 players die at the same time whist  both teams are 1 point away from winning
*/

var pointsRange = 7; //number of kills required per stage
var stageCount = 12; //don't go lower than 4 or higher than 36
var pointsToWin = pointsRange*stageCount;
var pointsToFinal = pointsRange*(stageCount-1);
var timer = 15; // in minutes
var delay = 90; // in seconds
var progressBar = {
  px: 50, // width of the progress bar (global)
  py: 1, // height of the progress bar (global)
  dbx: 1/28, // ratio of (big checkpoint witdth diameter)/(progressbar width)
  dby: 3, // ratio of (big checkpoint height diameter)/(progressbar height)
  dx: 1/43, // ratio of (small checkpoints witdth diameter)/(progressbar width)
  dy: 2, // ratio of (small checkpoints height diameter)/(progressbar height)
  offsetY: 10.2, //position from the top of screen (global)
  distanceY: 2 // height distance multiplier (global)
};

var modUtils = {
  setTimeout: function(f,time){
    this.jobs.push({f:f,time:game.step+time});
  },
  jobs: [],
  tick: function(){
    var t = game.step;
    for (var i=this.jobs.length-1;i>=0;i--){
      var job = this.jobs[i];
      if (t>=job.time){
        try {
          job.f();
        }
        catch (err){
        }
        this.jobs.splice(i,1);
      }
    }
  }
};

var sendUI = function(ship, UI){
  if (ship != null && typeof ship.setUIComponent == "function"){
    if (UI.visible || UI.visible == null) ship.setUIComponent(UI);
    else ship.setUIComponent({id: UI.id, position: [0,0,0,0], visible: false});
  }
};

