var scoreboard = {
  id:"scoreboard",
  visible: true,
  components: []
};

function updateScoreboard(game){
  scoreboard.components = [];
  for (let i=0; i<2; i++){
    scoreboard.components.push({type:"box",id:"la"+i,position:[0,0+i*50,100,7],fill:`hsla(${teams.hues[i]},100%,50%,1)`,stroke:"hsla(0, 0%, 41%, 1)",width:2});
    scoreboard.components.push({type:"text",id:"na"+i,position:[20,0+i*50,60,7],value:teams.names[i],color:"hsla(0, 0%, 0%, 1)"});
  }
  let icons = shiptree.icons;
  let colors = shiptree.color
  let line = 0, line2 = 0;
  let sa = []
  for (let i=0; i<game.ships.length; i++)
  sa[i] = game.ships[i];
  let sc = sa.sort((a,b) => b.custom.frags - a.custom.frags);
  for (let i=0; i<sc.length; i++){
    let ship = sc[i];
    let shipicon = icons[Math.trunc(ship.type/100)-1][(ship.type%10)-1];
    let color = colors[Math.trunc(ship.type/100)-1][(ship.type%10)-1];
    if (ship.type > 790) shipicon = "\u{1F30C}";
    let length = Math.log(ship.score) * Math.LOG10E + 1 | 0;
    let fix = 0;
    if (ship != null){
      switch (ship.custom.team){
        case 0:
          if (line>=5) break;
          scoreboard.components.push(
            {type:"player",id:ship.id,position:[1,7+(line*8+1.5),80,7],color:"hsla(210, 50%, 87%, 1)",align:"left"},
            {type:"text",position:[65,7+(line*8+1.5),60,7],value:shipicon,color:color},
            {type:"text",position:[29-fix,7+(line*8+1.5),60,7],value:ship.score,color:"hsla(210, 50%, 87%, 1)",align:"right"}
          )
          line++;
        break;
        case 1:
          if (line2>=5) break;
          scoreboard.components.push(
            {type:"player",id:ship.id,position:[1,57+(line2*8+1.5),80,7],color:"hsla(210, 50%, 87%, 1)",align:"left"},
            {type:"text",position:[65,57+(line2*8+1.5),60,7],value:shipicon,color:color},
            {type:"text",position:[29-fix,57+(line2*8+1.5),60,7],value:ship.score,color:"hsla(210, 50%, 87%, 1)",align:"right"}
          )
          line2++;
        break;
      }
    }
  }
  outputScoreboard(game);
};

function outputScoreboard(game){
  for (let ship of game.ships) {
    let o = [...scoreboard.components], t = scoreboard.components.map(x => (x.id != null)?x.id:-1).indexOf(ship.id);
    if (t != -1) scoreboard.components.splice(t,0,{type:"box",position:scoreboard.components[t].position.map((j,i) => (i==2)?100:j),fill:"hsla(210,24.3%,29%,0.5)"});
    sendUI(ship, scoreboard);
    scoreboard.components = [...o];
  }
}

this.event = function(event, game){
  let ship = event.ship;
  if (ship != null) switch (event.name){
    case "ship_destroyed":
      let killer = event.killer;
      if (killer != null){
        ship.set({collider:true});
        killer.set({collider:true});
        teams.points[killer.custom.team]++;
        teams.points2[killer.custom.team]++;
        teams.points2[killer.custom.team] = Math.trunc(teams.points2[killer.custom.team]);
        killer.custom.frags++;
        teams.points[killer.custom.team]%pointsRange==0?killer.custom.seventh=true:killer.custom.seventh=false;
        killer.type == teams.current[killer.custom.team]?killer.custom.points+=0.75:killer.custom.points++;
        if (!killer.custom.pending){
          modUtils.setTimeout(function(){
            if (killer.custom.ship != stages[`level_${killer.custom.stage+1}`]){
              if (killer.custom.stage < teams.level[killer.team]){
                if (killer.custom.points >= 1){
                  killer.custom.points--;
                  killer.custom.stage++;
                  killer.custom.ship = stages[`level_${killer.custom.stage}`];
                  killer.set({type:stages[`level_${killer.custom.stage}`],stats:88888888});
                }
              }
            }
          },10);
        }
      } else {
        if (!game.custom.final){
          teams.points[Math.abs(ship.custom.team-1)]++;
          teams.points2[Math.abs(ship.custom.team-1)]++;
          teams.points2[Math.abs(ship.custom.team-1)] = Math.trunc(teams.points2[Math.abs(ship.custom.team-1)]);
        }
      }
      ship.custom.deaths++;
      update = 1;
      ship.custom.hasbeenkilled = true;
      checkstatus(game);
      break;
    case "ship_spawned":
      if (ship.custom.team != null) random_spawns.setup(ship);
      update = 1;
      break;
    case "ui_component_clicked":
        let component = event.id;
        switch (component){
          case "tree":
            ship.custom.tree?shiptree.remove(ship):shiptree.tree(ship);
          break;
          case "get":
            sendUI(ship,{id:"get",visible:false});
            ship.custom.timer = false;
          break;
        }
    break;
  }
};
